result:
    .titlebox{
        width: 35%;
        height: 35px;
        background: rgba(0,161,255,0.7);
        text-align: center;
        color: #fff;
        line-height: 35px;
        margin: 0 auto;
        margin-top: -35px;
        border-radius: 10px;
    }
    .main-box{
        width: 100%;
        min-height: calc(100vh - 50px);
        background-color: rgb(8, 15, 62);
        padding: 20px;
    }
    .header{
        width: 100%;
        height: 45px;
        padding-top: 10px;
    }
    .header-text{
        color: #fff;
        font-size: 30px;
        font-weight: bold;
        text-align: center;
    }
    .chart-wrapper{
        padding: 16px 16px 0;
        margin-bottom: 32px;
        box-shadow: 0 0 10px 10px rgba(0,161,255,0.1);
        border: 1px solid #00a1ff;
        background: linear-gradient(#00faff, #00faff) left top,
		linear-gradient(#00faff, #00faff) left top,
		linear-gradient(#00faff, #00faff) right top,
		linear-gradient(#00faff, #00faff) right top,
		linear-gradient(#00faff, #00faff) left bottom,
		linear-gradient(#00faff, #00faff) left bottom,
		linear-gradient(#00faff, #00faff) right bottom,
		linear-gradient(#00faff, #00faff) right bottom;
        background-repeat: no-repeat;
        background-size: 5px 20px, 20px 5px;
        background-color: rgba(0,161,255,0.1);
    }
    .choosebox{
        width: 28%;
        height: 40px;
        margin-left: 70%;
        /deep/ .el-select,
        /deep/ .el-input,
        /deep/ .el-input__inner{
            background: rgba(0,161,255,0.2);
            color:#00faff;
            font-size: 16px;
            border:0px;
            border-radius:0px;
            text-align: center;
            border: #00a1ff 1px solid;
        }
        /deep/ .el-select-dropdown__list{
            background: #08164d;
            margin: 0px;
            border:0px;
            border-radius: 0px;
        }

        //修改单个的选项的样式
        /deep/ .el-select-dropdown__item{
            background-color: transparent;
        }

        //item选项的hover样式
        /deep/ .el-select-dropdown__item.hover, 
        /deep/ .el-select-dropdown__item:hover{
            color:#409eff;
        }
    }
